    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>content: &#34;**项目描述：**一只雌性淡色库蚊（Culex pipiens pallens），在叮咬人类后会发出类似现代汉语普通话的“好耶，咬到了”“哈哈，打不到我”等声音。\n**回收日期：**20██/██/██\n**回收地点：**研究员姜██家的卧室墙壁上\n**当前状态：**已被愤怒的研究员姜██用一本《文█哲》杂志拍击致死，残骸已回收，其发声原因仍在研究中\n**笔记：**它半夜在我枕头边叫个不停，拍死之后我才反应过来这是个异常——研究员姜██\n万物有灵，蚊子除外——研究员李██&#34;</textarea></pre>
